  \"2013-12-07T09:04:38.797341\",\n\t\"name\": \"water-supply-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"10/4/11 - The Western Area Water Supply
  areas have been added. It should be noted that WAWS overlaps with the Northwest
  Area Water Supply area (NAWS) due to an oversight on updating ND Century Code which
  should have removed the WAWS areas from NAWS. Additionally, a portion of the Southwest
  Water Pipeline Project (SWPP) overlaps WAWS in southeast McKenzie County as it is
  currently the only service provider in the area. nnThe Southwest Water Pipeline
  Project service area delineations were obtained from Bartlett & West Engineering
  and combined with the State Water Commissions boundaries/service areas for the Northwest
  Area Water Supply system.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
